import { Carousel, Card, Row } from 'react-bootstrap'

function OnlyCarousel() {
    const [index, setIndex] = React.useState(0);

    const handleSelect = (selectedIndex, e) => {
        setIndex(selectedIndex);
    };

    return (
        <Carousel activeIndex={index} onSelect={handleSelect} style={{
            width: '900px',
            height: '500px',
            margin: 'auto'
        }}>
            <Carousel.Item>
                <img
                    style={{ width: '100%', backgroundSize: 'cover', overflow: 'hidden' }}

                    src="muhalik.jpg"
                    alt="First slide"
                />
                <Carousel.Caption>
                    <h3>First slide label</h3>
                    <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img
                    style={{ width: '100%', backgroundSize: 'cover', overflow: 'hidden' }}
                    src="muhalik.jpg"
                    alt="Second slide"
                />
                <Carousel.Caption>
                    <h3>Second slide label</h3>
                    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
                </Carousel.Caption>
            </Carousel.Item>
            <Carousel.Item>
                <img
                    style={{ width: '100%', backgroundSize: 'cover', overflow: 'hidden' }}

                    src="muhalik.jpg"
                    alt="Third slide"
                />
                <Carousel.Caption>
                    <h3>Third slide label</h3>
                    <p> Praesent commodo cursus magna, vel scelerisque nisl consectetur </p>
                </Carousel.Caption>
            </Carousel.Item>
        </Carousel>
    );
}

const CarouselDiv = (props) => {
    return (
        <>
            <Row style={{ margin: '0%', padding: '3% 6%', width: '100%' }} noGutters>
                <OnlyCarousel />
                {/* <Card>
                    <Card.body>
                    </Card.body>
                </Card> */}
            </Row>
        </>
    )
}

export default CarouselDiv
